INSERT INTO `bs_article` VALUES ('4', 'harries', '2014-03-28 00:00:00', 'notice', '2014年端午节在即，为了便于公司同仁提前安排好工作和生活，现根据国务院办公厅通知精神及公司的福利政策，将“端午节”期间的放假安排通知如下：', '<p style=\"padding: 5px 0px; color: rgb(0, 0, 0); font-family: Simsun; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 28px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\"><strong>端午节：6月2日放假，与周末连休。</strong><br/></p><p style=\"padding: 5px 0px; color: rgb(0, 0, 0); font-family: Simsun; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 28px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">经国务院批准，现将2014年元旦、春节、清明节、劳动节、端午节、中秋节和国庆节放假调休日期的具体安排通知如下。<br/>一、元旦：1月1日放假1天。<br/>二、春节：1月31日至2月6日放假调休，共7天。1月26日（星期日）、2月8日（星期六）上班。<br/>三、清明节：4月5日放假，4月7日（星期一）补休。<span><span class=\"copytips\" style=\"font-size: 0px; color: rgb(245, 248, 253); width: 0px; overflow: hidden; height: 0px; display: inline-block;\"></span></span><br/>四、劳动节：5月1日至3日放假调休，共3天。5月4日（星期日）上班。<br/>五、端午节：6月2日放假，与周末连休。<br/>六、中秋节：9月8日放假，与周末连休。<br/>七、国庆节：10月1日至7日放假调休，共7天。9月28日（星期日）、10月11日（星期六）上班。</p><p><br/></p>', '2014-05-26 15:29:31', '2014年端午节放假安排通知');
INSERT INTO `bs_article` VALUES ('5', 'harries', '2014-03-28 00:00:00', 'news', '据中央人民广播电台报道 针对近日媒体报道太极公司中标铁路新一代客票系统工程情况，铁道部信息技术中心负责人作出回应称，\r\n							铁路新一代客票系统建设，是依据国家有关规定并面向社会公开进行招标的。其中，太极公司以1...', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;随着在线旅游行业繁荣发展，保障在线支付安全，已成为全社会关注的焦点。在此趋势下，在线旅行企业与金融机构之间的互通往来也日趋频繁。今日，去哪儿网与中国银行(601988,股吧)在北京签署支付战略合作协议。借此契机，去哪儿网将再度升级“担保通”体系，并将携手中国银行加强支付风险控制，强化在线支付安全。\r\n							去哪儿网副总裁杨威表示，升级的“担保通”体系中内嵌支付功能，将从&quot;前段认证体系&quot;、&quot;过程支付体系&quot;、&quot;后端赔付体系&quot;三大方面出发，为用户提供方便快捷的支付方式、最高效的资金解决方案和行业的信用解决方案，从中间环节加强保障消费者的在线支付安全。							</p><p>\r\n							&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;“本次合作是双方业务发展的共同需要，也是去哪儿网&quot;担保通&quot;体系升级迈出的重要一步。”杨威表示，中国银行可以借助去哪儿网的强大平台覆盖优势，为更广泛的用户提供优质服务和在线支付体验。去哪儿网也将携手中国银行加强在线支付风险控制，确保消费者的在线支付安全，同时，进一步丰富和升级“担保通”体系中内嵌的支付功能，为用户提供最方便快捷的支付方式、最高效的资金解决方案和行业的信用解决方案。							</p><p>\r\n							&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;中国银行北京分行副行长刘敏表示，近年来中国银行高度重视电子银行和电子支付工作，不断推进与战略伙伴的深度合作。中国银行非常荣幸与全球最大的中文在线旅行网站去哪儿网合作。过去，去哪儿网与中国银行就网银支付、协议快付等业务进行了深入合作。现在，中国银行持卡消费者可以不经过第三方支付平台，直接在去哪儿网上进行更安全、更便捷的购买支付，享受更优惠、优质的旅游体验。未来，中国银行将与去哪儿网通过优势资源的互补、共享等方式加强合作，为消费者提供更佳服务体验。</p>', '2014-04-15 13:54:15', '铁道部：购票网站招标没猫腻');
