INSERT INTO `bs_article` VALUES ('11', 'harries', '2014-03-28 00:00:00', 'notice', '为保障公司上下全体员工的合法权益，为彻底贯彻实施劳动保障相关法规，公司要求所有人员必须参加社会保险.现通知公司全体员工,凡未办理参保手续的员工,请于 年 月 日前到公司行政办部门办理参保手续.', '<pre id=\"answer-content-488462397\" class=\"answer-text mb-10\">第一节 职业准则</pre><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">　　一、基本原则 1 、公司倡导正大光明、诚实敬业的职业道德，要求全体员工自觉遵守国家<a href=\"http://hrnews.goodjob.cn/zhengcefagui/\" style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(0, 0, 255); text-decoration: underline;\"><span style=\"text-decoration:underline;margin: 0px; padding: 0px; border: 0px;\">政策法规</span></a>和公司规章制度。 2 、员工的一切职务行为，必须以公司利益为重，对社会负责。不做有损公司形象或名誉的事。 3 、公司提倡简单友好、坦诚平等的人际关系，员工之间应互相尊重，相互协作。 4 、公司内有亲属关系的员工应回避从事业务关联的工作。二、员工未经公司法人代表授权或批准，不能从事下列活动： 1 、以公司名义考察、谈判、签约 2 、以公司名义提供担保或证明 3 、以公司名义对新闻媒体发表意见、信息 4 、代表公司出席公众活动。</p><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">　　三、公司禁止下列情形兼职 1 、利用公司的工作时间或资源从事兼职工作 2 、兼职于公司的业务关联单位或商业竞争对手 3 、所兼职工作对本单位构成商业竞争 4 、因兼职影响本职工作或有损公司形象。</p><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">　　四、公司禁止下列情形的个人投资 1 、参与业务关联单位或商业竞争对手经营管理的 2 、投资于公司的客户或商业竞争对手的 3、以职务之便向投资对象提供利益的 4 、以直系亲属名义从事上述三项投资行为的</p><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">　　五、员工在对外业务联系中，若发生回扣或佣金的，须一律上缴公司财务部，否则视为贪污。</p><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">　　六、保密义务： 1 、员工有义务保守公司的经营机密，务必妥善保管所持有的涉密文件。 2 、员工未经授权或批准，不准对外提供公司密级文件、技术配方、工艺以及其他未经公开的经营情况、业务数据等。</p><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">&nbsp;</p><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">　　第二节 行为准则</p><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">　　一、工作期间衣着、发式整洁，大方得体，禁止奇装异服或过于曝露的服装。男士不得留长发、怪发，女士不留怪异发型，不浓妆艳抹。</p><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">　　二、办公时间不从事与本岗位无关的活动，不准在上班时间吃零食、睡觉、干私活、浏览与工作无关的网站、看与工作无关的书籍报刊。</p><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">　　三、禁止在办公区内吸烟，随时保持办公区整洁。</p><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">　　四、办公接听电话应使用普通话，首先使用“您好，XX公司”，通话期间注意使用礼貌用语。如当事人不在，应代为记录并转告。</p><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">　　五、禁止在工作期间串岗聊天，办公区内不得高声喧哗。</p><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">　　六、遵守电话使用规范，工作时间应避免私人电话。如确实需要，应以重要事项陈述为主，禁止利用办公电话闲聊。</p><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">　　七、文具领取应登记名称、数量，并由领取人签名。严禁将任何办公文具取回家私用。员工有义务爱惜公司一切办公文具，并节约使用 <br/></p><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">　　八、私人资料不得在公司打印、复印、传真。</p><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">　　九、未征得同意，不得使用他人计算机，不得随意翻看他人办公资料物品。需要保密的资料，资料持有人必须按规定保存。</p><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">　　十、根据公司需要及职责规定积极配合同事开展工作，不得拖延、推诿、拒绝；对他人咨询不属自己职责范围内的事务应就自己所知告知咨询对象，不得置之不理。</p><pre id=\"answer-content-488462397\" class=\"answer-text mb-10\"><br/>                                                                  特此通知<br/><br/>                                                                          公司行政部<br/>                                                                          2010年7月10日</pre><p><br/></p>', '2014-05-26 15:43:00', '新进公司的全体员工');
INSERT INTO `bs_article` VALUES ('12', 'harries', '2014-03-28 10:56:08', 'news', '据中央人民广播电台报道 针对近日媒体报道太极公司中标铁路新一代客票系统工程情况，铁道部信息技术中心负责人作出回应称，\r\n							铁路新一代客票系统建设，是依据国家有关规定并面向社会公开进行招标的。其中，太极公司以1...', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;随着在线旅游行业繁荣发展，保障在线支付安全，已成为全社会关注的焦点。在此趋势下，在线旅行企业与金融机构之间的互通往来也日趋频繁。今日，去哪儿网与中国银行(601988,股吧)在北京签署支付战略合作协议。借此契机，去哪儿网将再度升级“担保通”体系，并将携手中国银行加强支付风险控制，强化在线支付安全。\r\n							去哪儿网副总裁杨威表示，升级的“担保通”体系中内嵌支付功能，将从\"前段认证体系\"、\"过程支付体系\"、\"后端赔付体系\"三大方面出发，为用户提供方便快捷的支付方式、最高效的资金解决方案和行业的信用解决方案，从中间环节加强保障消费者的在线支付安全。\r\n							</p><P>\r\n							&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;“本次合作是双方业务发展的共同需要，也是去哪儿网\"担保通\"体系升级迈出的重要一步。”杨威表示，中国银行可以借助去哪儿网的强大平台覆盖优势，为更广泛的用户提供优质服务和在线支付体验。去哪儿网也将携手中国银行加强在线支付风险控制，确保消费者的在线支付安全，同时，进一步丰富和升级“担保通”体系中内嵌的支付功能，为用户提供最方便快捷的支付方式、最高效的资金解决方案和行业的信用解决方案。\r\n							</p><P>\r\n							&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;中国银行北京分行副行长刘敏表示，近年来中国银行高度重视电子银行和电子支付工作，不断推进与战略伙伴的深度合作。中国银行非常荣幸与全球最大的中文在线旅行网站去哪儿网合作。过去，去哪儿网与中国银行就网银支付、协议快付等业务进行了深入合作。现在，中国银行持卡消费者可以不经过第三方支付平台，直接在去哪儿网上进行更安全、更便捷的购买支付，享受更优惠、优质的旅游体验。未来，中国银行将与去哪儿网通过优势资源的互补、共享等方式加强合作，为消费者提供更佳服务体验。', '2014-03-28 10:57:13', '铁道部：购票网站招标没猫腻');
