0/cus/umeditor/upload/20140416/14511397631835121.tmp\" style=\"\"/></p><p><img src=\"http://127.0.0.1:8080/cus/umeditor/upload/20140416/97501397631837242.tmp\" _src=\"http://127.0.0.1:8080/cus/umeditor/upload/20140416/97501397631837242.tmp\" style=\"\"/></p><p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;随着在线旅游行业繁荣发展，保障在线支付安全，已成为全社会关注的焦点。在此趋势下，在线旅行企业与金融机构之间的互通往来也日趋频繁。今日，去哪儿网与中国银行(601988,股吧)在北京签署支付战略合作协议。借此契机，去哪儿网将再度升级“担保通”体系，并将携手中国银行加强支付风险控制，强化在线支付安全。\r\n							去哪儿网副总裁杨威表示，升级的“担保通”体系中内嵌支付功能，将从&quot;前段认证体系&quot;、&quot;过程支付体系&quot;、&quot;后端赔付体系&quot;三大方面出发，为用户提供方便快捷的支付方式、最高效的资金解决方案和行业的信用解决方案，从中间环节加强保障消费者的在线支付安全。							<br/></p><p>\r\n							&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;“本次合作是双方业务发展的共同需要，也是去哪儿网&quot;担保通&quot;体系升级迈出的重要一步。”杨威表示，中国银行可以借助去哪儿网的强大平台覆盖优势，为更广泛的用户提供优质服务和在线支付体验。去哪儿网也将携手中国银行加强在线支付风险控制，确保消费者的在线支付安全，同时，进一步丰富和升级“担保通”体系中内嵌的支付功能，为用户提供最方便快捷的支付方式、最高效的资金解决方案和行业的信用解决方案。							</p><p>\r\n							&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;中国银行北京分行副行长刘敏表示，近年来中国银行高度重视电子银行和电子支付工作，不断推进与战略伙伴的深度合作。中国银行非常荣幸与全球最大的中文在线旅行网站去哪儿网合作。过去，去哪儿网与中国银行就网银支付、协议快付等业务进行了深入合作。现在，中国银行持卡消费者可以不经过第三方支付平台，直接在去哪儿网上进行更安全、更便捷的购买支付，享受更优惠、优质的旅游体验。未来，中国银行将与去哪儿网通过优势资源的互补、共享等方式加强合作，为消费者提供更佳服务体验。</p>', '2014-04-16 15:04:10', '铁道部：购票网站招标没猫腻');
