INSERT INTO `bs_article` VALUES ('26', 'qqqq', null, 'news', 'qqqq', '<p><img src=\"http://127.0.0.1:8080/cus/umeditor/upload/20140416/22691397629688554.tmp\" _src=\"http://127.0.0.1:8080/cus/umeditor/upload/20140416/22691397629688554.tmp\"/></p><p><br/></p><p>package com.et59.cus.action;<br/>import java.io.IOException;<br/>import java.util.Date;<br/>import java.util.List;<br/>import java.util.Map;<br/><br/>import org.apache.log4j.Logger;<br/><br/>import com.alibaba.fastjson.JSON;<br/>import com.et59.cus.domain.entity.BsArticle;<br/>import com.et59.cus.domain.entity.ex.BsArticleQuery;<br/>import com.et59.cus.domain.entity.ex.Pager;<br/>import com.et59.cus.tools.ComonUtil;<br/>import com.et59.cus.tools.Constant;<br/>import com.et59.cus.tools.DateUtil;<br/><br/>/**<br/>&nbsp;* &lt;p&gt;Title: ResultAction.java&lt;/p&gt;<br/>&nbsp;* &lt;p&gt;Description: &lt;/p&gt;<br/>&nbsp;* &lt;p&gt;Copyright: 59et Software (c) 2011&lt;/p&gt;<br/>&nbsp;* &lt;p&gt;Company: 点滴工作室&lt;/p&gt;<br/>&nbsp;* @author Liuhh(jxausea@gmail.com)<br/>&nbsp;* @date 2012-2-24<br/>&nbsp;* @version 2.0<br/>&nbsp;*<br/>&nbsp;*/<br/>public class NewsAction extends BaseAction{<br/>&nbsp;&nbsp; &nbsp;/** <br/>&nbsp;&nbsp; &nbsp; * @Fields serialVersionUID : 序列化ID <br/>&nbsp;&nbsp; &nbsp; */ <br/>&nbsp;&nbsp; &nbsp;private static final long serialVersionUID = 1L;<br/>&nbsp;&nbsp; &nbsp;<br/>&nbsp; <br/>&nbsp;&nbsp; <br/>&nbsp;&nbsp; &nbsp;/**<br/>&nbsp;&nbsp; &nbsp; * 保存文章<br/>&nbsp;&nbsp; &nbsp; */<br/>&nbsp;&nbsp; &nbsp;public&nbsp; void save(){<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;boolean flag =false;<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;BsArticle&nbsp; bsArticle =getBsArticle();<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;try {<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;localServiceProxy.saveArticle(bsArticle);<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;flag = true;<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;response.setCharacterEncoding(&quot;UTF-8&quot;);<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;response.setContentType(&quot;text/html&quot;);<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;response.getWriter().print(flag);<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;} catch (Exception e) {<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;e.printStackTrace();<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;}<br/>&nbsp;&nbsp; &nbsp;}<br/>&nbsp;&nbsp; &nbsp;/**<br/>&nbsp;&nbsp; &nbsp; * 编辑文章<br/>&nbsp;&nbsp; &nbsp; */<br/>&nbsp;&nbsp; &nbsp;public&nbsp; void update(){<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;boolean flag =false;<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;String id =request.getParameter(&quot;id&quot;);<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;BsArticle&nbsp; bsArticle =getBsArticle();<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;bsArticle.setId(Long.valueOf(id));<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;try {<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;localServiceProxy.updateArticle(bsArticle);<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;flag = true;<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;response.setCharacterEncoding(&quot;UTF-8&quot;);<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;response.setContentType(&quot;text/html&quot;);<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;response.getWriter().print(flag);<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;} catch (Exception e) {<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;e.printStackTrace();<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;}<br/>&nbsp;&nbsp; &nbsp;}<br/>&nbsp;&nbsp; &nbsp;/**<br/>&nbsp;&nbsp; &nbsp; * 公共方法<br/>&nbsp;&nbsp; &nbsp; * @return<br/>&nbsp;&nbsp; &nbsp; */<br/>&nbsp;&nbsp; &nbsp;public&nbsp; BsArticle getBsArticle(){<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;String title =request.getParameter(&quot;title&quot;);<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;String createdate = request.getParameter(&quot;createdate&quot;);<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;String author = request.getParameter(&quot;author&quot;);<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;String type = request.getParameter(&quot;type&quot;);<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;String summary = request.getParameter(&quot;summary&quot;);<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;String content = request.getParameter(&quot;content&quot;);<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;BsArticle&nbsp; bsArticle = new BsArticle();<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;bsArticle.setTitle(title);<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;bsArticle.setSummary(summary);<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;bsArticle.setType(type);<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;bsArticle.setContent(content);<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;bsArticle.setUpdatedate(new Date());<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;bsArticle.setCreatedate(DateUtil.strToDate(createdate));<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;bsArticle.setAuthor(author);<br/>&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; &nbsp;return bsArticle;<br/>&nbsp;&nbsp; &nbsp;}<br/>}<br/><br/></p>', '2014-04-21 16:46:54', 'qqqqqqqqqqq');
INSERT INTO `bs_article` VALUES ('27', '你好', '2014-04-08 00:00:00', 'media', '擦擦擦擦擦擦擦擦擦擦擦擦', '<div class=\"para\"></div><p><a href=\"http://photo.haiwainet.cn/n/2014/0412/c346083-20525584-2.html\"><img src=\"http://photo.haiwainet.cn/NMediaFile/2014/0412/LOCAL201404121019000477355191253.jpg\" alt=\"　　参观少林寺常住院\" height=\"582\" width=\"719\"/></a><br/>\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</p><div class=\"gql5des\"><span style=\"color:#000000\">　　参观少林寺常住院</span></div><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;\r\n &nbsp; &nbsp; &nbsp; &nbsp;\r\n &nbsp; &nbsp;\r\n &nbsp; &nbsp;\r\n &nbsp; &nbsp;\r\n &nbsp; &nbsp;\r\n &nbsp; &nbsp;\r\n &nbsp; &nbsp;\r\n\r\n &nbsp; &nbsp;\r\n &nbsp; &nbsp; &nbsp; &nbsp;\r\n &nbsp; &nbsp; &nbsp; &nbsp;<br/></p><p>\r\n	<strong>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 海外网4月12日讯 </strong>据少林寺网站报道，2014年4月10日下午四点半，中央政治局委员、国务院副总理刘延东在国务院副秘书长江小涓、国家文物局局长励小捷、国家宗教局副局长蒋坚永等人的陪同下，到少林寺视察，受到释永信方丈及寺院僧众的热烈欢迎。</p><p>\r\n	&nbsp;&nbsp;&nbsp;　　在少林寺山门前，永信方丈率两序大众，列队欢迎刘延东副总理一行。在永信方丈的讲解下，刘延东副总理一行兴致勃勃地参观了少林寺常住院的建筑、\r\n雕塑、碑刻等文化遗存。当看到《皇唐嵩岳少林寺碑》和《三教九流图赞碑》之后，刘延东副总理对少林寺厚重的文化及传承赞叹不已。</p><p><br/></p>', '2014-04-18 18:31:39', '测试');
INSERT INTO `bs_article` VALUES ('28', 'Admin', '2014-05-26 00:00:00', 'notice', '没有规矩，不成方圆，所以，对于企业而言，制订一份规章制度非常重要，这样才能更好地管理员工。以下是一则公司规章制度范文，供各位企业管理人员参考', '<p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">1 、所有专职员工必须严格考勤管理,上下班亲自签到（午休不签到），不得代替他人签到。 2、迟到、早退、旷工</p><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">　　（1）迟到或早退 30 分钟以内者，每次扣发薪金 10 元。30 分钟以上 1 小时以内者，每次扣发薪金 20 元。超过 2 小时以上者必须提前办理请假手续，否则按旷工处理。</p><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">　　2 ）月迟到、早退累计达五次者，扣除相应薪金后，计旷工一次。旷工一次扣发一天双倍薪金。 年度内旷工三天及以上者予以辞退。</p><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">　　3 ）、请假 （ 1 ）病假</p><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">　　a 、员工病假须于上班开始的前 30 分钟内，即 8 ： 30 － 9 ： 00 致电部门负责人，请假一天以上的，病愈上班后须补假、县级以上医院就诊证明。 b 、员工因患传染病或其他重大疾病请假，病愈返工时需持区、县级以上医院出具的康复证明，经人事部门核定后，由公司给予工作安排。 (2) 事假：紧急突发事故可由自己或委托他人告知部门负责人批准，其余请假均应填写《请假单》，经权责领导核准，报人事部门备案，方可离开工作岗位，否则按旷工论处。事假期间不计发工资。</p><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">　　4 、出差(1) 员工出差前填好《出差申请单》呈权责领导批准后，报人事部门备案，否则按事假进行考勤。 (2) 出差人员原则上须在规定时间内返回，如需延期应告知部门负责人，返回后在《出差申请单》上注明事由，经权责领导签字按出差考勤。</p><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">　　5 、请假出差批准权限：三天以内由直接上级审批，三6 、加班 (1) 加班应填写《加班单》，经部门负责人批准后报部门备案，否则不计加班费。加班工时以考勤签到时间为准，以天为单位计算。</p><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">　　(2) 加班工资按以下标准计算：</p><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">　　工作日加班费＝加班天数×基数× 150 ％</p><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">　　休息日加班费＝加班天数×基数× 200 ％</p><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">　　法定节日加班费＝加班天数×基数× 300 ％</p><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">　　（ 3 ）人事部门负责审查加班的合理性及效率。（ 4 ）公司内临时工、兼职人员、部门主管（含）以上管理人员不计算加班费。 （ 5 ）公司实行轮班制的员工及驾驶员加班费计算办法将另行规定。 7 、考勤记录及检查（ 1 ）考勤负责人需对公司员工出勤情况于每月五日前（遇节假日顺延）将上月考勤予以上报，经部门领导审核后，报人事部门汇总，并对考勤准确性负责。（2 ）人事部门对公司考勤行使检查权，各部门领导对本部门行使检查权。检查分例行检查（每月至少两次）和随机检查。（ 3 ）对于在考勤中弄虚作假者一经发现，给予 200 元以上罚款，情节严重者作辞退处理。</p><p style=\"margin: 0px; padding: 0px; border: 0px; color: rgb(51, 51, 51); font-family: Verdana; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 25px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;\">　</p>', '2014-05-26 15:43:39', '考勤管理');
