ew&#39;;color:black\">10</span><span style=\"font-size:13px;font-family:宋体;color:black\">日下午四点半，中央政治局委员、国务院副总理刘延东在国务院副秘书长江小涓、国家文物局局长励小捷、国家宗教局副局长蒋坚永等人的陪同下，到少林寺视察，受到释永信方丈及寺院僧众的热烈欢迎。</span><span style=\"font-size:13px;font-family:&#39;Courier New&#39;;color:black\">&lt;/p&gt;&lt;p&gt;\\r\\n\\t&amp;nbsp;&amp;nbsp;&amp;nbsp;</span><span style=\"font-size:13px;font-family:宋体;color:black\">　　在少林寺山门前，永信方丈率两序大众，列队欢迎刘延东副总理一行。在永信方丈的讲解下，刘延东副总理一行兴致勃勃地参观了少林寺常住院的建筑、</span><span style=\"font-size:13px;font-family:&#39;Courier New&#39;;color:black\">\\r\\n</span><span style=\"font-size:13px;font-family: 宋体;color:black\">雕塑、碑刻等文化遗存。当看到《皇唐嵩岳少林寺碑》和《三教九流图赞碑》之后，刘延东副总理对少林寺厚重的文化及传承赞叹不已。</span><span style=\"font-size:13px;font-family:&#39;Courier New&#39;;color:black\">&lt;/p&gt;&lt;p&gt;&lt;br/&gt;&lt;/p&gt;&quot;,&quot;createdate&quot;:1396886400000,&quot;id&quot;:27,&quot;summary&quot;:&quot;</span><span style=\"font-size:13px;font-family:宋体;color:black\">擦擦擦擦擦擦擦擦擦擦擦擦</span><span style=\"font-size:13px;font-family:&#39;Courier New&#39;;color:black\">&quot;,&quot;title&quot;:&quot;</span><span style=\"font-size:13px;font-family:宋体;color:black\">测试</span><span style=\"font-size:13px;font-family:&#39;Courier New&#39;;color:black\">&quot;,&quot;type&quot;:&quot;media&quot;,&quot;updatedate&quot;:1397817099000}],&quot;total&quot;:26}}</span></p><p><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:red\">xml</span><span style=\"font-size:16px;font-family:宋体;color:red\">格式</span><span style=\"font-size:16px;font-family:&#39;Arial&#39;,&#39;sans-serif&#39;;color:red\">: </span></p><p style=\"text-align:left;text-autospace:none\"><span style=\"font-size:13px;font-family: &#39;Courier New&#39;;color:black\">&lt;com.et59.cus.domain.entity.ex.ReturnMsg&gt;</span></p><p style=\"text-align:left;text-autospace:none\"><span style=\"font-size:13px;font-family: &#39;Courier New&#39;;color:black\"><span>&nbsp; </span>&lt;msg&gt;</span><span style=\"font-size: 13px;font-fami